user_agent_parsers:
  # Example: Chrome/71.0.3578.98 Safari/537.36; 360Spider
  - regex: '(360Spider)'

  - regex: (AppEngine-Google)

  - regex: '(BingPreview)/(\d+)\.(\d+)'

  # Example: AppleWebKit/605.1.15 (KHTML, like Gecko) Dash/4.6.7 Xcode/8.3.3
  - regex: '(Dash)\/(\d+)\.(\d+)\.(\d+)'

  # Example: Chrome/49.0.2623.75 Safari/537.36 Google Favicon
  - regex: '(Google Favicon)'

  # Example: Gecko Firefox/11.0 (via ggpht.com GoogleImageProxy)
  - regex: '(GoogleImageProxy)'

  - regex: '(Google Web Preview)'

  - regex: '(SkypeUriPreview)'

  - regex: 'via (Fastmail)'

  - regex: '(Whale)/(\d+)\.(\d+)\.(\d+)\.(\d+)'

  - regex: '(WordPress\.com mShots)'
